  false,\n\t\"url\": null,\n\t\"notes\": \"These data are the characteristics of the
  individual live trees found in 0.05-ha circular plot habitat samples taken in 2005
  at sample points at Spears and Didion Ranches, Placer County, California. There
  were three 0.05-ha circular habitat sampling plots at each of the 15 sample points.
  To be counted, trees had to be > 4\" dbh and within the 12.6 m radius plot. If a
  plot number is missing, then there were no trees at the sample points and vegetation
  plots.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
